/* eslint-disable no-unused-vars */
import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

import './App.css';

const App = () =>
  function Home() {
    return <h2>Home</h2>;
  }

  function About() {
    return <h2>About</h2>;
  }

  function Users() {
    return <h2>Users</h2>;
  }

  <Router>
    <>
      <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>
    </>

    <Switch>
      <Route path="/">
        <>
          <h1>Home</h1>
        </>
      </Route>

      <Route path="/">
        <>
        </>
      </Route>

      <Route path="/">
        <>
        </>
      </Route>
    </Switch>

  </Router>

export default App;
